import axios from "axios";

export const Settings = () => {

    const logout = () => {
        axios.get('http://localhost:5000/api/logout')
    }


  return (
    <div className="flex">
      <button className="bg-red-500 px-4 py-2 text-sm float-right text-white rounded-md  my-4 mx-5">Logout</button>
    </div>
  );
};
